let state = {
    profilePage: {
       posts: [
        { id: 1, message: 'Hello people!', countLikes: '15' },
        { id: 2, message: "I'm hunter", countLikes: '20' },
        { id: 3, message: "I'll stay good programmer", countLikes: '15' },
    ],
    dialogs: [
        { id: 1, name: 'Alexander' },
        { id: 2, name: 'Natasha' },
        { id: 3, name: 'Katya' },
        { id: 4, name: 'Maxim' },
        { id: 5, name: 'Pasha' },
    ], 
    },

    messagesPage: {
        messages: [
            { id: 1, message: 'Hi' },
            { id: 2, message: 'How are you?' },
            { id: 3, message: 'Yo' },
        ] 
    }

}

export default state
